■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>コロ付きレールですので、ラクラク引き出せます!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5266/9109bs-01.jpg" width="600" height="900"><br><font size=3></font></div><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="900" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5266/9109bs-02.jpg"><br><font size="3">使用イメージ</font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="900" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5266/9109bs-03.jpg"><br><font size="3">コロ付きレールで引き出しラクラク。</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">湿気の多い洗面台下に最適の18-8ステンレス製!お手入れも簡単で、永くお使いいただけます。脚元にはすべり止めのゴムクッション付き。安定性も十分です。浅め・深めのカゴで収納も便利です。洗剤や石鹸のストックに最適です!</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">湿気の多い洗面台下に最適の18-8ステンレス製!お手入れも簡単で、永くお使いいただけます。脚元にはすべり止めのゴムクッション付き。安定性も十分です。浅め・深めのカゴで収納も便利です。洗剤や石鹸のストックに最適です!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">幅25.5&times;奥行35&times;高さ35.5cm<br>個装サイズ：28&times;37&times;38cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">1.3kg<br>個装重量：1800g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">18-8ステンレス</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">完成品<br>深カゴ：高さ21.5cmまでのものが収納可能</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">脚ゴム4個</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
